BOOST_AUTO_TEST_CASE(variousInputErrors)
{
    // control table not having correct definitions for data table (or header field not correct) 
    //                                                 parentNode, subnodeOfParent, primaryKey, foreignKey, rootElemRec
    std::vector<std::vector<std::string>> control = { {"root",      "",              "a",        "",         "rec" } ,
                                                      {"root.rec",  "",              "",         "a",        "b" } };
    std::vector<std::vector<std::vector<std::string>>> data = { { {"a.x",     "b","c.d" }, 
                                                                {  "dataA1","", "dataCD1" },
                                                                {  "dataA2","", "dataCD2" } },
                                                                { {"b",     "a" },
                                                                {  "dataB1","dataA1" },
                                                                {  "dataB2","dataA1" },
                                                                {  "dataB3","dataA2" },
                                                                {  "dataB4","dataA2" }, } };

    int result = 0;
    std::string resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): primary key not found in parent table for table with rootNode root.rec (maybe a wrong header field name) !");

    // control table having too little rows
    control = { {"root",      "",              "a",        "",         "rec" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): control table rows need to be same as amount of data tables passed !");

    // control table having too many columns
    control = { {"root",      "",              "a",        "",         "rec", "toomuch" },
                {"root.rec",  "",              "",         "a",        "b" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): control table columns need to be 5 !");

    // control table column 1 empty
    control = { {"",      "",              "a",        "",         "rec"},
                {"root.rec",  "",              "",         "a",        "b" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): parentNode (control table column 1) must not be empty !");

    // control table column 5 empty
    control = { {"root",      "",              "a",        "",         ""},
                {"root.rec",  "",              "",         "a",        "b" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): rootElemRec (control table column 5) must not be empty !");

    // control table column 5 empty (2nd definition)
    control = { {"root",      "",              "a",        "",         "rec"},
                {"root.rec",  "",              "",         "a",        "" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): rootElemRec (control table column 5) must not be empty !");

    // control table parent table root node not found
    control = { {"root",      "",              "a",        "",         "rec"},
                {"notexist.rec",  "",          "",         "a",        "b" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): no root node found in previous definitions for row with parentNode notexist.rec (parentNode needs to match the combination of rootNode (optional), subnodeOfParent and rootElemRec of parent table) !");

    // control table parent table root node not found
    control = { {"root",      "notexist",      "a",        "",         "rec"},
                {"root.rec",  "",              "",         "a",        "b" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): no root node found in previous definitions for row with parentNode root.rec (parentNode needs to match the combination of rootNode (optional), subnodeOfParent and rootElemRec of parent table) !");

    // foreign key (primary key of parent) not given in parent definition
    control = { {"root",      "",              "",        "",         "rec", },
                {"root.rec",  "",              "",         "a",        "b" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): no primary key name in parent definition (parentNode=root, subNode=) given, check primaryKey column there !");

    // control foreign key not found as primary key in parent table (primary key name not equal to foreignKeyName)
    control = { {"root",      "",              "a",        "",         "rec"},
                {"root.rec",  "",              "",         "notfound",        "b" } };
    result = 0;
    resultString = TreeizeRelD::writeTreeAndCreateXML(control, data, &result);
    BOOST_TEST(result == 1);
    BOOST_TEST(resultString == "(writeTree): primary key name in parent definition (parentNode=root, subNode=) not equal to foreignKeyName of definition row with parentNode root.rec !");

}